import React from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
  background-color: white; /* Fond blanc */
  color: #333; /* Couleur du texte sombre pour contraster avec le fond blanc */
  min-height: 100vh;
  padding: 4rem 2rem;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

const Title = styled.h1`
  font-size: 3rem;
  color: #4facfe; /* Couleur bleue pour correspondre au design */
`;

const Subtitle = styled.p`
  font-size: 1.5rem;
  margin-top: 1rem;
`;

const Home = () => {
  return (
    <HomeContainer>
      <Title>Bienvenue sur mon portfolio</Title>
      <Subtitle>Découvrez mon travail, mon expérience, et mes projets.</Subtitle>
    </HomeContainer>
  );
};

export default Home;
